import React from "react";
import ReactDOM from "react-dom";


function App() {
    const firstName = "Joe"
    const lastName = "Schmoe"

    return (
        <h1> Hello {firstName}    {lastName} ! </h1>
    )
}

  


ReactDOM.render( <App/> , document.getElementById("root"));
